        <p>Places an order for the user's cart items.</p>
<p>This method takes a PlaceOrderRequest object as input and processes the user's cart items
to create a new order. The user's ID is obtained from the request and used to retrieve the cart
from the database. Inside a database transaction, the order is created and associated with the user.
The total price, payment method, and additional notes are copied from the request to the order.</p>
<p>Next, the selected items from the cart are looped through and each item is added to the order
by creating a new order item with the product ID, quantity, and price copied from the cart item.</p>
<p>Finally, the createInvoices() method is called to generate invoices for the order, and a new
OrderResource object is returned representing the created order.</p>
