                <h1 id="webhook"
        class="sl-text-5xl sl-leading-tight sl-font-prose sl-text-heading"
    >
        Webhook
    </h1>

    <p>Handles incoming webhook requests from Deliveree and updates order and shipping statuses.</p>
<p>This method processes the webhook payload and updates the associated order's status
and shipping information based on the received delivery status. It also dispatches
appropriate events when specific statuses are encountered.</p>

