        <p>Handles the webhook request for updating order and shipping statuses.</p>
<p>Processes the request by validating the given status and updating the
associated order and shipping details accordingly. Dispatches events
based on the current status of the order and saves any changes.</p>
<p>Accepted statuses include:</p>
<ul>
<li>delivery_completed</li>
<li>locating_driver</li>
<li>driver_accept_booking</li>
<li>delivery_in_progress</li>
<li>locating_driver_timeout</li>
<li>canceled</li>
</ul>
<p>The function retrieves the respective <code>OrderShipping</code> record using the provided
booking ID and updates the associated <code>Order</code> and <code>shipping</code> data if applicable.</p>
